    publication_id: "0x05-0x264a-DA-3d891d3e",
    content:
      'What I find really fascinating about the Vitalik\u0027s culture post \u003chttps://vitalik.eth.limo/general/2024/05/29/l2culture.html\u003e\n\nis this part: "*If you really value having a blockchain that remains decentralized, even at the cost of being slow, you need to look not just at how well the present-day technology accomplishes those goals, but also at how well the culture values those goals. If a blockchain\u0027s culture does not value curiosity and openness to new technology, then it may well fail at both decentralization and speed, because it fails to take up new technologies like ZK-SNARKs that can get you more of both at the same time.*"\n\nAs blockspace is becoming more affordable with L2s and especially with Validium combined with UX tools like Paymasters, Smart Wallets and Embedded Wallets, its very easy to state that the mainstream users don\u0027t care about the underlying tech, they just want x.\n\nWhile its true that products need to be simple, great and accessible, we should not forget that the underlying culture should always care whats important. To me thats decentralization, open graph and open source technology. We should steer away from shortcuts or hacks on the interface level that fully diminishes these fundamentals that sets the culture.\n\nBuild for the users, for the culture.',
