      "Basically Lens team introduce Profile Guardian with LIP-4 https://github.com/lens-protocol/LIPs/blob/main/LIPs/lip-4.md\n\nObjective was to avoid phishing attemps on Lens profiles (similar to other NFTs) and it has been working amazingly well. You can\u0027t move your Profile NFT unless you activate cooldown and that takes 7 days. So if there is a phishing attempt by doing permit behalf of you, the attempt will fail. So someone would need to first phish you to unlock the guardian and then move the NFT meaning that you would need to return to the phishing site which is unlikely to happen after more than 1 day.",
