    content:
      "In the light of going permissionless, we added more community gardeners (and kept some Lens team members for now) to the report spam/bots and low quality signals. As usual, the protocol allows anyone to post content and interact with other users. Lens API is used to enable enhanced experience across Lens apps thats using Lens.\n\nHere is the list (if you want to help, feel free to drop your name below in the comments)\n\nlens/pedrovilela\nlens/nilesh\nlens/kipto\nlens/zkjew\nlens/arterlioz\nlens/augustuscaesar\nlens/jamesfinnerty\nlens/1_cryptoman\nlens/definn\nlens/albiverse\nlens/punkess\nlens/lens\nlens/aave\nlens/stani\nlens/wagmi\nlens/yoginth\nlens/bradorbradley\nlens/christina\nlens/pablo\nlens/essah\nlens/sasicodes\nlens/jouni\nlens/paris\nlens/nicolo\nlens/helpfulbrother\nlens/cantech\nlens/pawel\nlens/cesare\nlens/cree\n\nThese profiles operate with 3 strike system. Report once \u003d 1 week rate limit, report twice \u003d 3 week rate limit, report three times \u003d indefinite rate limit on the API. Kind reminder that rate limit will only reduce reach through Lens API (used by many of the Lens apps) and apps that have their own backend that would reflect the gardener actions. Developers have the opt-in option to use it or not. Reported users data is still retrievable from the protocol level and these users (most likely bots) would be still able to interact with the protocol but friendly apps won\u0027t give them reach.\n\nThere is no data available for who reported a profile for obvious reasons, however flags can be disputed (dispute system can be created via LIP for example).\n\nThis system is a quick win for permissionless and can be improved and governed via LIP as we the community can assess how the system works. Adding and removing names could also be governed via LIP in the future (i.e. removing Lens team members etc). Hopefully gardeners will make Lens a better place upon going permissionless.\n\nFeel free to leave your thoughts below.",
    main_content_focus: "TEXT_ONLY",
    timestamp: "2024-02-13 10:25:51.000000 UTC",
