    content:
      "I‚Äôve been encountering forks for a while now and have few findings that everyone might find useful. First of all, forks are important for the open source culture and replication of the software. Forking code for learning purposes or even commercial purposes fuels innovation. Usually there is no point of reinventing the wheel while some modifications or improvements might be helpful on a fork. Fork can also be a community-driven decision on vision. Maybe there are two paths to improve the codebase and enabling both visions requires forking (Linux distributions for example).\n\nIn web3 forking has been a method to fuel new communities (and some cases just to enforce meaningless token farming). Forked code has helped to distribute software across different EVM networks and I would argue that having a copy of Uniswap on every network make sense especially on networks where transactions fees are lower as it helps to onboard more users from centralized finance, faster that the core team could deploy, adding net positive value.\n\nHowever, some of the protocols onchain might be technically and economically complex systems. This means that forking these protocols would require the engineers to understand these systems inside out, otherwise there might be potential issues or open attack vectors. Most of the exploits over the past years in DeFi has been the cause of the developers mainly not knowing the code while implementing minir changes and thats a fundamental problem with complex DeFi protocols (lending, complex amms etc).\n\nWhen you are using a complex fork be mindful that the developer team on the fork doesn‚Äôt necessarily have sufficient understanding of the codebase even if its a identical fork, in case of issues there might be less understanding for remedy and how to fix things. When you are using a fork, you are taking excess risk. Which can be okay if you agree on taking it.",
    main_content_focus: "TEXT_ONLY",
