      "Web3 today centers around expressing transferable, financialized assets, rather than encoding social relationships of trust. Yet many core economic activities‚Äîsuch as uncollateralized lending and building personal brands‚Äîare built on persistent, non-transferable relationships. In this paper, we illustrate how non-transferable ‚Äúsoulbound‚Äù tokens (SBTs) representing the commitments, credentials, and affiliations of ‚ÄúSouls‚Äù can encode the trust networks of the real economy to establish provenance and reputation. More importantly, SBTs enable other applications of increasing ambition, such as community wallet recovery, sybil-resistant governance, mechanisms for decentralization, and novel markets with decomposable, shared rights. We call this richer, pluralistic ecosystem ‚ÄúDecentralized Society‚Äù (DeSoc)‚Äîa co-determined sociality, where Souls and communities come together bottom-up, as emergent properties of each other to co-create plural network goods and intelligences, at a range of scales. Key to this sociality is decomposable property rights and enhanced governance mechanisms‚Äîsuch as quadratic funding discounted by correlation scores‚Äîthat reward trust and cooperation while protecting networks from capture, extraction, and domination. With such augmented sociality, web3 can eschew today‚Äôs hyper-financialization in favor of a more transformative, pluralist future of increasing returns across social distance.\n\nhttps://papers.ssrn.com/sol3/papers.cfm?abstract_id\u003d4105763",
