      "Careful everyone with phising scams out there! ‚ö†Ô∏è\n\nThere has been few incidents recently where community members lost their profiles due to a phishing scam on Twitter and its heartbreaking to see folks losing their profile even if they can rebuild the audience, its not the experience we are looking for even on a protocol level. üòû\n\nWe build the Lens Protocol to be agnostic to various social networking use-cases and also realized that being able to secure your profile is extremely important for the users. While we have seen some iterations of tools to secure profiles, we introduced a way to add additional security (and make it normie proof) measures for Lens V2 that would mitigate similar attempts.\n\nSince Lens has grown so much in the past year and has an active community, we feel that we need to take action sooner and deploy a solution that helps to secure the profiles on similar scams. Therefore, we are going to release an update that improves significantly the security of the profiles before Lens V2. This is our priority now. ‚ö°Ô∏è\n\nThank you for helping out to point the issues and if anyone has experienced a phising attack or seen one, please DM across Lens.\n\nRest stay tuned for the update üåø\n\n",
